(795, 10, 506, 0, 186, 'Asus hôm nay âm thầm ra mắt model laptop mới của mình mang tên U46SV-DH51 với kiểu dáng mỏng 2,6 cm và cân nặng chỉ 2,2 kg. Model này có màn hình 14 inch độ phân giải 1.366 x 768 pixel và cả ổ quang DVD theo kèm.\r\n\r\nU46SV-DH51 có cấu hình tốt với vi xử lý Intel Core i5-2410M tốc độ 2,3 GHz, bộ nhớ RAM 4 GB, card đồ họa rời Nvidia GeForce, ổ cứng dung lượng 640 GB. Pin 8 cell đi kèm máy được Asus hứa hẹn cho thời lượng sử dụng lên tới 10 tiếng.\r\n\r\nU46SV-DH51 dự kiến sẽ bắt đầu bán vào ngày 1/10 và đã cho đặt hàng với giá 880 USD.'),
