(186, 39, 'simple', NULL, '2011-09-23 08:20:15', 'Asus hôm nay âm thầm ra mắt model laptop mới của mình mang tên U46SV-DH51 với kiểu dáng mỏng 2,6 cm và cân nặng chỉ 2,2 kg. Model này có màn hình 14 inch độ phân giải 1.366 x 768 pixel và cả ổ quang DVD theo kèm.\r\n\r\nU46SV-DH51 có cấu hình tốt với vi xử lý Intel Core i5-2410M tốc độ 2,3 GHz, bộ nhớ RAM 4 GB, card đồ họa rời Nvidia GeForce, ổ cứng dung lượng 640 GB. Pin 8 cell đi kèm máy được Asus hứa hẹn cho thời lượng sử dụng lên tới 10 tiếng.\r\n\r\nU46SV-DH51 dự kiến sẽ bắt đầu bán vào ngày 1/10 và đã cho đặt hàng với giá 880 USD.', 1, 0, 0, '/a/s/asus-46sv.jpg', '', 0, 0, NULL, NULL, NULL, 'Asus U46SV-DH51', NULL, NULL, '22000000.0000', NULL, NULL, NULL, 0, NULL, 'Asus hôm nay âm thầm ra mắt model laptop mới của mình mang tên U46SV-DH51 với kiểu dáng mỏng 2,6 cm và cân nặng chỉ 2,2 kg. Model này có màn hình 14 inch độ phân giải 1.366 x 768 pixel và cả ổ quang DVD theo kèm.\r\n\r\nU46SV-DH51 có cấu hình tốt với vi xử lý Intel Core i5-2410M tốc độ 2,3 GHz, bộ nhớ RAM 4 GB, card đồ họa rời Nvidia GeForce, ổ cứng dung lượng 640 GB. Pin 8 cell đi kèm máy được Asus hứa hẹn cho thời lượng sử dụng lên tới 10 tiếng.\r\n\r\nU46SV-DH51 dự kiến sẽ bắt đầu bán vào ngày 1/10 và đã cho đặt hàng với giá 880 USD.', 'Asus U46SV-DH51', NULL, '/a/s/asus-46sv.jpg', '', NULL, NULL, NULL, 2, '/a/s/asus-46sv.jpg', '', '2011-09-23 08:25:16', 'asus-u46sv-dh51', 'asus-u46sv-dh51.html', 4, NULL, NULL),
