(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', '', '<div class="page-head-alt"><h3>Whoops, our bad...</h3></div>\r\n<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<br/>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd>\r\n<dd>\r\n<ul class="disc">\r\n<li><a href="#" onclick="history.go(-1);">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br/><a href="{{store url=""}}">Store Home</a><br/><a href="{{store url="customer/account"}}">My Account</a></li></ul></dd></dl><br/>\r\n<p><img src="{{skin url=''images/media/404_callout1.jpg''}}" style="margin-right:15px;"/><img src="{{skin url=''images/media/404_callout2.jpg''}}" /></p>', '2007-06-20 18:38:32', '2007-08-26 19:11:13', 1, 0, NULL, NULL, '', NULL, NULL, NULL),
(2, 'Home page', 'two_columns_left', '', '', 'home', '', '<div>\r\n<p>{{block type="joomlart_jmproductsslider/list" name="home.jmproductsslider.list" }} {{block type="joomlart_jmproducts/list" title="Sản phẩn c&oacute; b&aacute;n" name="home.jmproducts.list" }}</p>\r\n</div>', '2007-08-23 10:03:25', '2011-09-21 08:28:56', 1, 0, '<block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page"><action method="addPriceBlockType"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n<block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new"><action method="addPriceBlockType"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n<block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed"><action method="addPriceBlockType"><type>bundle</type><block>bundle/catalog_product_price</block><template>bundle/catalog/product/price.phtml</template></action></block>\r\n<reference name="left">\r\n            <block type="poll/activePoll" name="left.poll" after="callout">\r\n                <action method="setPollTemplate"><template>poll/active.phtml</template><type>poll</type></action>\r\n                <action method="setPollTemplate"><template>poll/result.phtml</template><type>results</type></action>\r\n            </block>\r\n</reference>', '', '', '', NULL, NULL),
