(66, 66, 1, 'not bad', 'yeah it''s alright I suppose', 'ryhrhrh', NULL),
(67, 67, 1, 'Top of the top', 'I''ve been wearing these shoes since 1912 and believe me, they''re hot !', 'Didier', NULL),
(68, 68, 2, 'nice deal', 'made my living room looks great again', 'lopsta.com', NULL),
(69, 69, 1, 'Nice', 'very coll design', 'dimsal', NULL),
(70, 70, 1, 'This ist great - Love the style', 'I`ve been looking for such a couch for months now I''ve found it!', 'JBrunner', 1),
