(75, 75, 1, 'very cool', 'I love these', 'ilja', NULL),
(76, 76, 1, 'Excellent quality', 'The Sony producs have alway had an excellent quality and value.', 'Dr. Gish', NULL),
(77, 77, 1, 'This notebook is great', 'This very high quality notebook great for office and business applications. ', 'tane', NULL),
(78, 78, 1, 'Mega shoes', 'I like it ...', 'Tester', 1),
(79, 79, 1, 'Increased my profit margins by 15%', 'These shoes are great....I was in so much demand with my usal tricks...I could put my prices up by 15%... These shoes will definitely work wonders on your  Supply and Demand curve on your local turf :)', 'Lady of the night', NULL),
